    false,nt"url": null,nt"notes": "New York City Results on the New York State
    English Language Arts (ELA) Tests, Grades 3 - 8rnNotes:rnAs of 2006, the New York
    State Education Department expanded the ELA and mathematics testing programs to
    Grades 3-8. Previously, state tests were administered in Grades 4 and 8 and citywide
    tests were administered in Grades 3, 5, 6, and 7.rnStarting in 2010, NYSED changed
    the scale score required to meet each of the proficiency levels, increasing the
    number of questions students needed to answer correctly to meet proficiency.rnIn
    2007, the New York State Education Department updated its testing policy for English
    Language Learners: ELLs in an English Language School System for more than one year
    are required to take the ELA exam. Previously, ELLs in an English Language School
